import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import FormDesigner from './FormDesigner';
import ViewDesignedFormButton from './ViewDesignedFormButton';
import DesignedForm from './DesignedForm'

function DesignedFormPage() {
  return (
    <div>
      <h1>Designed Form Page</h1>
      <DesignedForm fields={fields} className="mt-8" />
    </div>
  );
}

function App() {
  return (
    <Router>
      <div className="App">
        <Routes>
          <Route path="/" element={<FormDesigner />} />
          <Route path="/designed-form" element={<DesignedFormPage />} />
        </Routes>
        {/* <ViewDesignedFormButton /> */}
      </div>
    </Router>
  );
}

export default App;
